  display:flex;
  color:'black'; 
  background-color:'#F9F9F9'; 
  height:100%;
  width:100%;
  justify-content: center;
  align-items: center;
`;

const Wrapper = styled.div`

  height:59%;
  width:65% ;
  overflow-x: scroll;
  display:'block'
  padding-left:5px;

`;

function App() {
